import React, { Component } from 'react'
import Skeleton_Loading from '../pages/Skeleton_Loading'
import Navbar from '../pages/Navbar'

export class Loading extends Component {
  render() {
    return (
      <>
      <div>
        <Navbar />
        <Skeleton_Loading />
      </div>
      </>
    )
  }
}

export default Loading
